import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";

const Router = () => {


    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<h1>home</h1>} />
                <Route path="/test" element={<h1>test</h1>} />
            </Routes>
        </BrowserRouter>
    )
}

export default Router
